Case: 45M with acute chest pain, ST elevation in II, III, aVF => Inferior MI (STEMI). Troponin elevated. So primary diagnosis: Acute inferior myocardial infarction (STEMI). ICD-10: I21.19 (ST elevation MI of other sites) or I21.09? Let's recall: I21.09 is "ST elevation (STEMI) myocardial infarction involving other coronary artery". I21.09 is for other sites, I21.01 for anterior wall, I21.11 for inferior. Actually ICD-10 codes: I21.0 = ST elevation MI of anterior wall, I21.1 = ... inferior wall, I21.2 = ... other sites. So I21.1 for inferior wall. So we can use I21.1.

Differential diagnoses (3-5): Unstable angina, Aortic dissection (though less likely), Pulmonary embolism, Pericarditis, Esophageal spasm. Provide confidence.

Key findings: crushing substernal chest pain radiating to left arm, diaphoresis, nausea, ST elevation in II, III, aVF, elevated troponin and CK-MB, risk factors.

Tests: immediate: repeat ECG, cardiac biomarkers serial, chest X-ray, bedside echocardiography, coronary angiography, labs (CBC, BMP, coagulation), lipid panel, blood glucose. Priorities: coronary angiography urgent (immediate), repeat ECG urgent, cardiac biomarkers urgent, bedside echo urgent, chest X-ray routine? We'll list.

Management: immediate: Activate cath lab, MONA-B (morphine, oxygen if needed, nitrates, aspirin, beta-blocker, anticoagulation), give aspirin 325 mg chew, P2Y12 inhibitor (clopidogrel 300 mg loading), unfractionated heparin bolus, consider high-intensity statin, analgesia, nitrates.

Medications: Aspirin 325 mg PO chew, Clopidogrel 300 mg PO loading, Heparin (unfractionated) 70 U/kg IV bolus, Nitroglycerin 0.4 mg SL q5min PRN (up to 3 doses), Metoprolol 5 mg IV q5min up to 15 mg (if no contraindication), Morphine 2-4 mg IV q5-15 min PRN, Atorvastatin 80 mg PO loading.

Consultations: Cardiology: emergent, Interventional cardiology urgent.

Red flags: hypotension, arrhythmias, heart block, cardiogenic shock, refractory chest pain, signs of heart failure.

